CREATE DEFINER=`root`@`localhost` PROCEDURE `set_photo`()
BEGIN
  declare x INT default 101;
  declare photo INT default 0;
  WHILE x <= 200 DO
	set photo = (photo + 1) % 7;
    update users set avatar = concat('users/user-',photo,'.jpeg') where id = x;
    SET x = x + 1;
  END WHILE;
END ;;
